import React from 'react';
import DefaultLayout from '../layouts/DefaultLayout';

const About = () => {
    return(
        <DefaultLayout>
            <h1>
                Bio:
                <br/>
                I am a artist that focuses on acrylc canvas paintings but can do graphic drawings as well.            
                </h1>
                <br/>
                <h2>
                    Contact Info:
                    <br/>
                    Cell: xxx xxx xxxx
                    <br/>
                    Email: xxxxxx@gmail.com
                </h2>
            <p>ABOUT PAGE</p>

        </DefaultLayout>
    );
};

export default About;
